import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import styled from 'styled-components';
import logo1 from '../pictures/Background.png';
import logo2 from '../pictures/head.png';
import logo3 from '../pictures/scissors.png';

const Logo = styled.img`
  height: 3em;
`
const Styles = styled.div`
  .navbar {
    background-color: #000;
  }

  .nav-link {
    font-size: 2em;
    margin: 0 0.25em;
  }
  
  .head {
    width: 3em;
    height: auto;
    margin: 0 1em;
  }

  p {
    text-align: center;
    font-size: 2em;
  }
`


function Header() {
  return (
    <Styles>
      <Navbar variant="dark" expand="sm" fixed="top">
        <Navbar.Brand href="#home">
          {/* <Logo src={logo1} alt="logo" /> */}
          <p>Barber</p>
          <Logo className="head" src={logo2} alt="logo" />
          {/* <Logo src={logo3} alt="logo" /> */}
          <p>Andrew</p>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#services">Sevices</Nav.Link>
            <Nav.Link href="#contact">Contact</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </Styles>
  );



}

export default Header;
